import axios from "axios";
const URL = "/api/businesses";

export default {
    search: function () {
        console.log("api.js")
        return axios.get("/api/businesses")
    },
    add: function (id, rating) {
        return axios.put(`${URL}/${id}`, { rating });
    }
}
